import React, { useState, useEffect } from "react";

const AddProduct = () => {
  const [product, setProduct] = useState({
    name: "",
    description: "",
    status: true,
    category: "",
    stock: 0,
    price: 0,
    image: "",
  });

  const [unsplashImages, setUnsplashImages] = useState([]);
  const [searchTerm, setSearchTerm] = useState("tshirt");

  useEffect(() => {
    fetch(
      `https://api.unsplash.com/search/photos?query=${searchTerm}&client_id=YOUR_UNSPLASH_ACCESS_KEY`
    )
      .then((res) => res.json())
      .then((data) => setUnsplashImages(data.results));
  }, [searchTerm]);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setProduct({
      ...product,
      [name]: type === "checkbox" ? checked : value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Product submitted:", product);
    // Add your backend POST logic here
  };

  return (
    <div className="max-w-4xl mx-auto p-6">
      <h1 className="text-2xl font-bold mb-4">Add Product</h1>
      <form onSubmit={handleSubmit} className="space-y-4">
        <input
          type="text"
          name="name"
          placeholder="Title"
          value={product.name}
          onChange={handleChange}
          className="w-full p-2 border rounded"
        />

        <textarea
          name="description"
          placeholder="Description"
          value={product.description}
          onChange={handleChange}
          className="w-full p-2 border rounded"
        />

        <div>
          <input
            type="text"
            placeholder="Search Image"
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            className="w-full p-2 border mb-2 rounded"
          />
          <div className="grid grid-cols-3 gap-2 max-h-48 overflow-y-auto">
            {unsplashImages.map((img) => (
              <img
                key={img.id}
                src={img.urls.thumb}
                alt="preview"
                onClick={() => setProduct({ ...product, image: img.urls.small })}
                className={`h-24 w-full object-cover rounded cursor-pointer border-2 ${
                  product.image === img.urls.small ? "border-blue-500" : "border-transparent"
                }`}
              />
            ))}
          </div>
        </div>

        <div>
          <label className="block font-medium mb-1">Status</label>
          <select
            name="status"
            value={product.status}
            onChange={handleChange}
            className="w-full p-2 border rounded"
          >
            <option value={true}>Active</option>
            <option value={false}>Inactive</option>
          </select>
        </div>

        <div>
          <label className="block font-medium mb-1">Category</label>
          <select
            name="category"
            value={product.category}
            onChange={handleChange}
            className="w-full p-2 border rounded"
          >
            <option value="">Select a category</option>
            <option value="Electronics">Electronics</option>
            <option value="Fashion">Fashion</option>
            <option value="Beauty">Beauty</option>
            <option value="Home">Home</option>
            <option value="Gadgets">Gadgets</option>
          </select>
        </div>

        <input
          type="number"
          name="stock"
          placeholder="Stock"
          value={product.stock}
          onChange={handleChange}
          className="w-full p-2 border rounded"
        />

        <input
          type="number"
          name="price"
          placeholder="Price"
          value={product.price}
          onChange={handleChange}
          className="w-full p-2 border rounded"
        />

        <button
          type="submit"
          className="w-full p-2 bg-black text-white font-bold rounded hover:bg-gray-800"
        >
          Add Product
        </button>
      </form>
    </div>
  );
};

export default AddProduct;
